import React from 'react'

function FooterCard({ one, two, theere, four }) {
    return (
        <div class="footer-mid-all mid-left">
            <h3>
                {one}
            </h3>
            <p>
                {two}
            </p>
            <p>
                {theere}
                <span>
                    Hiring!
                </span>
            </p>
            <p>
                {four}
            </p>
        </div>
    )
}

export default FooterCard
